TSUNIT_TEST(kilib_CLayer_BasicTests, isInitedReturnsFalseUponObjectsConstruction)
{
    kilib::CLayer layer;

    // A just constructed Object is not inited. So checkIt
    UT_EXPECT_FALSE(layer.isInited());

}

TSUNIT_TEST(kilib_CLayer_BasicTests, testInit_MustFailUponZeroNodes)
{
    kilib::CLayer layer;

    utils::CMath math;
    // Attempt to hand over 0 nodes. This is an error. So it must fail!
    UT_EXPECT_FALSE(layer.init(0, nullActivation, math, nullptr));

    // Attempt to hand over 1 node. This is fine. So it must succeed!
    UT_EXPECT_TRUE(layer.init(1, nullActivation, math, nullptr));
}

TSUNIT_TEST(kilib_CLayer_BasicTests, testInit_AskIfIsInitedRespondsCorrect)
{
    utils::CMath math;

    {
        kilib::CLayer layer;
        // Attempt to hand over 0 nodes. This is an error. So it must fail and hence keep isInited at false
        layer.init(0, nullActivation, math, nullptr);
        UT_EXPECT_FALSE(layer.isInited());
    }

    {
        kilib::CLayer layer;
        // Attempt to hand over 1 node. This is fine. So it must succeed!
        layer.init(1, nullActivation, math, nullptr);
        UT_EXPECT_TRUE(layer.isInited());
    }
}

