TSUNIT_TEST(kilib_CLayer_BasicTests, weightningVectorForNeuronAtIndex_matches_parentNeuronsPlusOne)
{
    utils::CMath math;

    kilib::CLayer layer[2];
    layer[0].init(3, nullActivation, math, nullptr);
    layer[1].init(2, nullActivation, math, &layer[0]);

    {
        const auto* weightningVector = layer[1].weightningVectorForNeuronAtIndex(0);
        UT_EXPECT_NE(nullptr, weightningVector);

        // Expect that every Neuron of Layer[1] has the count of Neurons of the PARENT layer
        // PLUS 1 (because of the neural component used for the bias)
        UT_EXPECT_EQ(3 + 1, weightningVector->size());
    }
    {
        const auto* weightningVector = layer[1].weightningVectorForNeuronAtIndex(1);
        UT_EXPECT_NE(nullptr, weightningVector);

        // Expect that every Neuron of Layer[1] has the count of Neurons of the PARENT layer
        // PLUS 1 (because of the neural component used for the bias)
        UT_EXPECT_EQ(3 + 1, weightningVector->size());
    }
    {
        const auto* weightningVector = layer[1].weightningVectorForNeuronAtIndex(2);
        UT_EXPECT_EQ(nullptr, weightningVector);
    }
}

