TSUNIT_TEST(kilib_CLayer_BasicTests, adressingWeightsAndBiasesDirectAndIndirect)
{
    utils::CMath math;

    kilib::CLayer layer[2];
    layer[0].init(3, nullActivation, math, nullptr);
    layer[1].init(2, nullActivation, math, &layer[0]);

    // Assign some Values to the Input layers neurons
    auto* inputVector = layer[0].neuronOutputVector();

    (*layer[1].weightningVectorForNeuronAtIndex(0))[0] = 1.2f; // Weightning L1[Neuron 0, Index 0]
    (*layer[1].weightningVectorForNeuronAtIndex(0))[1] = 2.3f; // Weightning L1[Neuron 0, Index 1]
    (*layer[1].weightningVectorForNeuronAtIndex(0))[2] = 3.4f; // Weightning L1[Neuron 0, Index 2]
    (*layer[1].weightningVectorForNeuronAtIndex(0))[3] = 5.6f; // Bias L1[Neuron 0]

    (*layer[1].weightningVectorForNeuronAtIndex(1))[0] = 2.1f; // Weightning L1[Neuron 1, Index 0]
    (*layer[1].weightningVectorForNeuronAtIndex(1))[1] = 3.2f; // Weightning L1[Neuron 1, Index 1]
    (*layer[1].weightningVectorForNeuronAtIndex(1))[2] = 4.3f; // Weightning L1[Neuron 1, Index 2]
    (*layer[1].weightningVectorForNeuronAtIndex(1))[3] = 5.4f; // Bias L1[Neuron 1]

    UT_EXPECT_EQ(1.2f, *(layer[1].weightningAtIndexForNeuron(0, 0)));
    UT_EXPECT_EQ(2.3f, *(layer[1].weightningAtIndexForNeuron(0, 1)));
    UT_EXPECT_EQ(3.4f, *(layer[1].weightningAtIndexForNeuron(0, 2)));
    UT_EXPECT_EQ(5.6f, *(layer[1].biasForNeuron(0)));

    UT_EXPECT_EQ(2.1f, *(layer[1].weightningAtIndexForNeuron(1, 0)));
    UT_EXPECT_EQ(3.2f, *(layer[1].weightningAtIndexForNeuron(1, 1)));
    UT_EXPECT_EQ(4.3f, *(layer[1].weightningAtIndexForNeuron(1, 2)));
    UT_EXPECT_EQ(5.4f, *(layer[1].biasForNeuron(1)));
}

