TSUNIT_TEST(kilib_CLayer_ActivationTests, checkIfTheActivationObjectsMethodsHasBeenCalled)
{
    utils::CMath math;
    
    kilib::CLayer layer[1];
    
    // Create a Spy class that will be used to create a supervised activation object.
    class CustomActivation : public kilib::CLayer::IActivation
    {
    public:
        CustomActivation() = default;
        
        virtual bool needsIntegralPart() const override
        {
            ++_needsIntegralPartCnt;
            return false;
        }
        
        virtual float activation(float inLearningRate, float inIntegtedValue, float inThisValue) const override
        {
            ++_activationCnt;
            return inThisValue;
        }
        
        mutable unsigned int _needsIntegralPartCnt = 0;
        mutable unsigned int _activationCnt = 0;
    } customActivation;
    
    layer[0].init(3, customActivation, math, nullptr);
    
    // Assign some Values to the Input layers neurons
    (*layer[0].neuronOutputVector())[0] = 1.2f; // Neuron L0[Index 0]
    (*layer[0].neuronOutputVector())[1] = 2.4f; // Neuron L0[Index 1]
    (*layer[0].neuronOutputVector())[2] = 4.6f; // Neuron L0[Index 2]
    
    // non recursive propgation
    layer[0].forwardPropagation();
    
    // ask the spy if the custom activation methods has been called?
    
    // Expect that _needsIntegralPartCnt has been called at least once
    UT_EXPECT_TRUE(customActivation._needsIntegralPartCnt >= 1);
    
    // The activation has to be called for every nern in this layer
    UT_EXPECT_EQ(3, customActivation._activationCnt);
}

