TSUNIT_TEST(kilib_CLayer_ComplexTests, nonRecursiveForwardPropagation_simpleNet)
{
    utils::CMath math;

    kilib::CLayer layer[2];
    layer[0].init(3, nullActivation, math, nullptr);
    layer[1].init(2, nullActivation, math, &layer[0]);

    // Assign some Values to the Input layers neurons
    (*layer[0].neuronOutputVector())[0] = 1.2f; // Neuron L0[Index 0]
    (*layer[0].neuronOutputVector())[1] = 2.4f; // Neuron L0[Index 1]
    (*layer[0].neuronOutputVector())[2] = 4.6f; // Neuron L0[Index 2]

    *layer[1].weightningAtIndexForNeuron(0, 0) = 4.5f; // Weightning L1[Neuron 0, Index 0]
    *layer[1].weightningAtIndexForNeuron(0, 1) = 3.2f; // Weightning L1[Neuron 0, Index 1]
    *layer[1].weightningAtIndexForNeuron(0, 2) = 2.1f; // Weightning L1[Neuron 0, Index 2]
    *layer[1].biasForNeuron(0) = 1.8f; // Bias L1[Neuron 0]

    *layer[1].weightningAtIndexForNeuron(1, 0) = 14.5f; // Weightning L1[Neuron 1, Index 0]
    *layer[1].weightningAtIndexForNeuron(1, 1) = 13.2f; // Weightning L1[Neuron 1, Index 1]
    *layer[1].weightningAtIndexForNeuron(1, 2) = 12.1f; // Weightning L1[Neuron 1, Index 2]
    *layer[1].biasForNeuron(1) = 11.8f; // Bias L1[Neuron 1]

    // non recursive propgation
    layer[0].forwardPropagation(); layer[1].forwardPropagation();

    constexpr float expected_dot_neron0 = 1.2f *  4.5f + 2.4f *  3.2f + 4.6f *  2.1f +  1.8f;
    constexpr float expected_dot_neron1 = 1.2f * 14.5f + 2.4f * 13.2f + 4.6f * 12.1f + 11.8f;

    UT_EXPECT_EQ((*layer[1].neuronOutputVector())[0], expected_dot_neron0);
    UT_EXPECT_EQ((*layer[1].neuronOutputVector())[1], expected_dot_neron1);
}

TSUNIT_TEST(kilib_CLayer_ComplexTests, recursiveForwardPropagation_simpleNet)
{
    utils::CMath math;

    kilib::CLayer layer[2];
    layer[0].init(3, nullActivation, math, nullptr);
    layer[1].init(2, nullActivation, math, &layer[0]);

    // Assign some Values to the Input layers neurons
    (*layer[0].neuronOutputVector())[0] = 1.2f; // Neuron L0[Index 0]
    (*layer[0].neuronOutputVector())[1] = 2.4f; // Neuron L0[Index 1]
    (*layer[0].neuronOutputVector())[2] = 4.6f; // Neuron L0[Index 2]

    *layer[1].weightningAtIndexForNeuron(0, 0) = 4.5f; // Weightning L1[Neuron 0, Index 0]
    *layer[1].weightningAtIndexForNeuron(0, 1) = 3.2f; // Weightning L1[Neuron 0, Index 1]
    *layer[1].weightningAtIndexForNeuron(0, 2) = 2.1f; // Weightning L1[Neuron 0, Index 2]
    *layer[1].biasForNeuron(0) = 1.8f; // Bias L1[Neuron 0]

    *layer[1].weightningAtIndexForNeuron(1, 0) = 14.5f; // Weightning L1[Neuron 1, Index 0]
    *layer[1].weightningAtIndexForNeuron(1, 1) = 13.2f; // Weightning L1[Neuron 1, Index 1]
    *layer[1].weightningAtIndexForNeuron(1, 2) = 12.1f; // Weightning L1[Neuron 1, Index 2]
    *layer[1].biasForNeuron(1) = 11.8f; // Bias L1[Neuron 1]

    // non recursive propgation
    layer[1].forwardPropagation(true); //true -> Propagate output value evaluation towards parent layers.

    constexpr float expected_dot_neron0 = 1.2f *  4.5f + 2.4f *  3.2f + 4.6f *  2.1f +  1.8f;
    constexpr float expected_dot_neron1 = 1.2f * 14.5f + 2.4f * 13.2f + 4.6f * 12.1f + 11.8f;

    UT_EXPECT_EQ((*layer[1].neuronOutputVector())[0], expected_dot_neron0);
    UT_EXPECT_EQ((*layer[1].neuronOutputVector())[1], expected_dot_neron1);
}

